import React from "react";
import { Link } from "react-router-dom";
import styles from "../styles/Navbar.module.css";

const LinksBar = () => {
  return (
    <nav>
      <div className={styles.nav__content}>
        <Link to="/">Головна</Link>
        <Link>Послуги</Link>
        <Link>Відгуки</Link>
        <Link>Про нас</Link>
        <Link>Контакти</Link>
        <Link>Блог</Link>
      </div>
    </nav>
  );
};

export default LinksBar;
